import React from 'react';
import Bienvenida from './component/Bienvenida.jsx';
import Cards from './component/Cards.jsx';
import ListadoNombres from './component/ListadoNombres.jsx';
/* import ListadoNombres from './component/ListadoNombres'; */

function App() {
  return (
    <div >
      <h1 >Propiedades Objetos</h1>
      <ListadoNombres/>
      <Bienvenida nombre ="Manuel"/>
    <hr/>
      <div className="row">
        <div className="col">
          <Cards
            imagen ="http://lorempixel.com/150/150/"
            titulo = "titulo imagen 1"
            texto = "texto imagen 1" 
          />
        </div>
      </div>

    </div>
  );
}

export default App;
